import React, { useEffect, useRef, useState, useMemo, useCallback } from 'react';
import { fishVarieties } from '../mockData';
import { Star, Filter } from 'lucide-react';
import { Button } from './ui/button';

const FishVarietiesSection = () => {
  const [isVisible, setIsVisible] = useState(false);
  const [selectedCategory, setSelectedCategory] = useState('All');
  const [hoveredCard, setHoveredCard] = useState(null);
  const sectionRef = useRef(null);

  useEffect(() => {
    const observer = new IntersectionObserver(
      ([entry]) => {
        if (entry.isIntersecting) {
          setIsVisible(true);
        }
      },
      { threshold: 0.1 }
    );

    if (sectionRef.current) {
      observer.observe(sectionRef.current);
    }

    return () => {
      if (sectionRef.current) {
        observer.unobserve(sectionRef.current);
      }
    };
  }, []);

  const categories = ['All', 'Premium', 'Saltwater'];

  const filteredFish = useMemo(() => {
    return selectedCategory === 'All'
      ? fishVarieties
      : fishVarieties.filter(fish => fish.category === selectedCategory);
  }, [selectedCategory]);

  const handleCategoryChange = useCallback((category) => {
    setSelectedCategory(category);
  }, []);

  const handleMouseEnter = useCallback((id) => {
    setHoveredCard(id);
  }, []);

  const handleMouseLeave = useCallback(() => {
    setHoveredCard(null);
  }, []);

  return (
    <section id="varieties" ref={sectionRef} className="py-20 bg-white">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className={`text-center mb-12 transition-all duration-1000 transform ${
          isVisible ? 'translate-y-0 opacity-100' : 'translate-y-10 opacity-0'
        }`}>
          <h2 className="text-4xl md:text-5xl font-bold text-[#003366] mb-4">Fresh Varieties</h2>
          <div className="w-24 h-1 bg-[#FF6600] mx-auto mb-6"></div>
          <p className="text-lg text-gray-700 max-w-2xl mx-auto">
            Explore our wide selection of fresh fish and seafood, sourced daily from the ocean
          </p>
        </div>

        <div className="flex justify-center items-center gap-2 mb-12 flex-wrap bg-gray-100 p-2 rounded-full w-fit mx-auto">
          <Filter className="text-[#003366] ml-2" size={18} />
          {categories.map((category) => (
            <button
              key={category}
              onClick={() => handleCategoryChange(category)}
              className={`relative px-6 py-2.5 rounded-full font-semibold text-sm transition-all duration-300 ${
                selectedCategory === category
                  ? 'text-white shadow-lg transform scale-105'
                  : 'text-[#003366] hover:text-[#FF6600]'
              }`}
            >
              {selectedCategory === category && (
                <span className="absolute inset-0 bg-gradient-to-r from-[#FF6600] to-[#FF8533] rounded-full animate-fade-in"></span>
              )}
              <span className="relative z-10">{category}</span>
            </button>
          ))}
        </div>

        <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-4 gap-8" key={selectedCategory}>
          {filteredFish.map((fish) => (
            <div
              key={fish.id}
              className="bg-white rounded-xl overflow-hidden shadow-lg hover:shadow-2xl transition-shadow duration-200 transform hover:-translate-y-1 cursor-pointer animate-fade-in"
              onMouseEnter={() => handleMouseEnter(fish.id)}
              onMouseLeave={handleMouseLeave}
            >
              <div className="relative overflow-hidden h-48">
                <img
                  src={fish.image}
                  alt={fish.name}
                  className={`w-full h-full object-cover transition-transform duration-300 ${
                    hoveredCard === fish.id ? 'scale-110' : 'scale-100'
                  }`}
                  loading="lazy"
                />
                {fish.isPremium && (
                  <div className="absolute top-3 right-3 bg-[#FF6600] text-white px-3 py-1 rounded-full text-xs font-semibold flex items-center gap-1">
                    <Star size={12} fill="white" />
                    Premium
                  </div>
                )}
                <div className="absolute bottom-0 left-0 right-0 bg-gradient-to-t from-black/60 to-transparent p-4">
                  <h3 className="text-white font-bold text-xl">{fish.name}</h3>
                </div>
              </div>
              <div className="p-5">
                <div className="flex justify-between items-center mb-3">
                  <span className="text-sm bg-[#E8F4F8] text-[#003366] px-3 py-1 rounded-full font-medium">
                    {fish.category}
                  </span>
                  <span className="text-[#FF6600] font-bold text-lg">{fish.priceRange}</span>
                </div>
                <p className="text-gray-600 text-sm">{fish.description}</p>
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default FishVarietiesSection;
